import React, { useState, useEffect } from "react";
import { getCash } from "../api/CashApi";
import NewCash from "./NewCash";

const Cash = () => {
  const [cashData, setCashData] = useState([]);
  const [showModal, setShowModal] = useState(false);

  const fetchCashData = async () => {
    try {
      const data = await getCash();
      setCashData(data);
    } catch (error) {
      console.error("Error fetching cash data:", error);
    }
  };

  useEffect(() => {
    fetchCashData();
  }, []);

  const handleNewCash = (newCash) => {
    setCashData((prevCashData) => [...prevCashData, newCash]);
  };

  return (
    <div className="cash-container">
      <div className="header-card">
        <p className="title">Cash</p>
        <i
          className="btn btn-primary fa-solid fa-plus"
          id="trade-new-btn"
          onClick={() => setShowModal(true)}
        ></i>
      </div>
      <hr />
      <table className="cash-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Entry Date</th>
            <th>Initial Cash</th>
            <th>User ID</th>
          </tr>
        </thead>
        <tbody>
          {cashData.map((cash) => (
            <tr key={cash.id}>
              <td>{cash.id}</td>
              <td>{cash.entry_date}</td>
              <td>{cash.initial_cash}</td>
              <td>{cash.user_id}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {showModal && (
        <NewCash
          onClose={() => setShowModal(false)}
          onNewCash={handleNewCash}
        />
      )}
    </div>
  );
};

export default Cash;
